import { Grid, TextField, withStyles } from "@material-ui/core";
import React from "react";
import useForm from "./useForm";

const styles = theme => ({
        "& .MuiTableCell-root":{
margin: theme.spacing(1),
minWidth:230,
        },
})

const initialFieldValues = {
    fullName: '',
    mobile: '',
    email: '',
    age: '',
    bloodGroup: '',
    address: ''
}

const DCandidateForm = (props) => {
    const {
        values,
        setValues,
        handleInputChange
    } = useForm(initialFieldValues);

    return (
        <form autoComplete="off" noValidate>
            <Grid container spacing={2}>
                <Grid item xs={6}>
                    <TextField
                        name="fullName"
                        variant="outlined"
                        label="Full Name"
                        value={values.fullName}
                        onChange={handleInputChange}
                        fullWidth
                    />
                    <TextField
                        name="email"
                        variant="outlined"
                        label="Email"
                        value={values.email}
                        onChange={handleInputChange}
                        fullWidth
                    />
                    <TextField
                        name="bloodGroup"
                        variant="outlined"
                        label="Blood Group"
                        value={values.bloodGroup}
                        onChange={handleInputChange}
                        fullWidth
                    />
                </Grid>
                <Grid item xs={6}>
                    <TextField
                        name="mobile"
                        variant="outlined"
                        label="Mobile"
                        value={values.mobile}
                        onChange={handleInputChange}
                        fullWidth
                    />
                    <TextField
                        name="age"
                        variant="outlined"
                        label="Age"
                        value={values.age}
                        onChange={handleInputChange}
                        fullWidth
                    />
                    <TextField
                        name="address"
                        variant="outlined"
                        label="Address"
                        value={values.address}
                        onChange={handleInputChange}
                        fullWidth
                    />
                </Grid>
            </Grid>
        </form>
    );
}

export default DCandidateForm;
